    return (
        <header className={s.header}>
        <img src='https://img1.pnghut.com/24/13/23/GCM7vZjvN9/grass-leaf-ecosystem-environmental-science-green.jpg' alt = 'backfone'/>
        <div className={s.loginBlock}>Login</div>
            <NavLink></NavLink>
      </header>
    )
}

export default Header
